import * as React from 'react';
import styled from 'styled-components';
import Box from '@mui/material/Box';

import './Myaccount.css'





function Myaccount() {
  return (




    <Box
      style={{
        marginTop: '120px',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
       
        
      }}
    >
      <Box
        style={{
          color: 'white',
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
          maxWidth: '100%',
          overflow: 'auto',
        }}
      >


      
    <Box className="box1">
     <Box className="mainContainer">welcome </Box>
     </Box>
     
     </Box></Box>
     
  );

}


export default  Myaccount;
